formElementLabelManager={initilize:e=>{Array.from(e.getElementsByClassName("field-label-option-select-menu")).forEach(e=>{e.addEventListener("change",e=>{let t=e.target.closest(".widget-editor-body").querySelector(".label-text-container");"None"===e.target.value?t.classList.add("d-none"):t.classList.remove("d-none")}),e.dispatchEvent(new Event("change"))})}},document.addEventListener("DOMContentLoaded",()=>formElementLabelManager.initilize(document));